import Todo from './components/Todo'


function App() {
  return (
    <div className="App">
      <h1>ToDo List React</h1>
      <h2>
      What needs to be done?
      </h2>
      <input type="text" placeholder="Add a new ToDo"></input>
      <button type="submit">Add</button>
      <ul>

        <li>Studiare Matematica</li>
      </ul>
    </div>
  );
}

export default App;
